import { TabPanel, TabPanels, VStack } from "@chakra-ui/react";

const Chat = () => {
  return (
    <VStack>
      <TabPanels>
        <TabPanel>Friend 1</TabPanel>
        <TabPanel>Friend 2</TabPanel>
        <TabPanel>Friend 3</TabPanel>
      </TabPanels>
    </VStack>
  );
};

export default Chat;
